#!/usr/bin/perl

# a(n) = smallest pseudoprime to base 2 with n prime factors.
# https://oeis.org/A007011

use 5.020;
use strict;
use warnings;

use Storable;
use Math::GMPz;
use ntheory qw(:all);
use Math::Prime::Util::GMP;
use experimental qw(signatures);

my $storable_file = "cache/factors-fermat.storable";
my $fermat        = retrieve($storable_file);

my %table;

while (my ($key, $value) = each %$fermat) {

    my @factors = split(' ', $value);
    my $count   = scalar(@factors);

    next if ($count < 13);

    my $n = Math::GMPz->new($key);

    if (exists $table{$count}) {
        next if ($table{$count} < $n);
    }

    $table{$count} = $n;
}

foreach my $k (sort { $a <=> $b } keys %table) {
    printf("a(%3d) <= %s\n", $k, $table{$k});
}

__END__
